C.S Lewis 
Tentei resumir essa coletânea de 7 clássicos da fantasia que mudaram profundamente a forma de escrever para crianças e renderam prêmios como a Carnegie Medal
𝐎 𝐬𝐨𝐛𝐫𝐢𝐧𝐡𝐨 𝐝𝐨 𝐦𝐚𝐠𝐨: Digory e Polly são levadas a mundos desconhecidos por anéis mágicos feitos pelo tio do garoto. Em uma dessas terras eles encontram a cruel Feiticeira. Conhecemos também Aslan, uma entidade poderosa em forma de leão.
𝐎 𝐋𝐞ã𝐨, 𝐚 𝐅𝐞𝐢𝐭𝐢𝐜𝐞𝐢𝐫𝐚 𝐞 𝐨 𝐆𝐮𝐚𝐫𝐝𝐚-𝐫𝐨𝐮𝐩𝐚: os irmãos Pedro, Susana, Edmundo e Lúcia são levadas à Nárnia por um guarda-roupa mágico e lá descobrem que fazem parte da profecia sobre os humanos que acabarão com o eterno inverno instaurado pela Feiticeira Branca.
𝐎 𝐂𝐚𝐯𝐚𝐥𝐨 𝐞 𝐬𝐞𝐮 𝐦𝐞𝐧𝐢𝐧𝐨: ambientada na Calormânia, país dominado pelos cruéis Tarcaãs, conta a jornada de Shasta, um menino que prestes a ser vendido, foge com seu cavalo falante para as terras de Nárnia. 
𝐎 𝐏𝐫í𝐧𝐜𝐢𝐩𝐞 𝐂𝐚𝐬𝐩𝐢𝐚𝐧: os quatro irmãos voltam à Nárnia para colocar fim ao reinado do tirano Miraz, que usurpou o trono de seu sobrinho e instaurou o terror.
𝐀 𝐯𝐢𝐚𝐠𝐞𝐦 𝐝𝐨 𝐏𝐞𝐫𝐞𝐠𝐫𝐢𝐧𝐨 𝐝𝐚 𝐀𝐥𝐯𝐨𝐫𝐚𝐝𝐚: conta a aventura de Lúcia, Edmundo e seu mimado primo Eustáquio pelos mares misteriosos em busca de 7 nobres desaparecidos. A transformação da personalidade de Eustáquio é o ponto alto da narrativa.
𝐀 𝐂𝐚𝐝𝐞𝐢𝐫𝐚 𝐝𝐞 𝐏𝐫𝐚𝐭𝐚: Eustáquio volta à Nárnia com Jill Polly para encontrar o filho perdido de Caspian. Eles contam com a ajuda de Paulama Brejeiro, uma das figuras mais simpáticas e cômicas do livro.
𝐀 ú𝐥𝐭𝐢𝐦𝐚 𝐛𝐚𝐭𝐚𝐥𝐡𝐚: A crônica mais intensa de todas, conta os acontecimentos 200 anos após a última aventura, onde todas as crianças retornam para ajudar Rilian a recuperar o trono das mãos de um audacioso macaco. O final é surpreendente e melancólico, fechando o livro com uma pitadinha de tristeza para o leitor.
